package j30_java_program;

public class A1_Swap_2no {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10, b=20;
		System.out.println("befor swapping values are,,"+a+"  "+b);

		
		int t=a;
		a=b;
		b=t;
		System.out.println("after swaping values are.."+a+"  "+b);
		
	}

}

